import React from "react";

export default function ToMars() {
    return (
        <div className="to-mars container">
            <div className="to-mars-headline-container flex-box">
                <h1>TO <span>MARS</span> <br></br> <span style={{marginLeft: "200px", fontWeight: ""}}>AND BACK</span></h1>
                <div className="tag-charcoal">
                    <p>JOURNEY</p>
                </div>
                <div className="to-mars-img-container">
                    <img src="https://i.postimg.cc/9QXb9Dzn/pexels-pixabay-355906.png" alt="image" />
                </div>
            </div>
        </div>
    )
}
